import React from "react";
import Avatar from "./Avatar";

function Card(props) {
  return (
    <div className="card">
        <h2 className="name">{props.name}</h2>
        <Avatar img={props.img} />
        <p className="desc">{props.description}</p> 
    </div>
  );
}

export default Card;
